import React, { useEffect } from 'react'
import HeaderBar from '../../components/HeaderBar'
import Footer from '../../components/Footer'
import MainTopSection from './MainTopSection'
import MainMidSection from './MainMidSection'
import MainBtmSection from './MainBtmSection'
import { updateBoxofficeDB } from '../../axios/main/movieLogic'

const MainPage = () => {
 
  useEffect(() => {
    const getUpdateBoxofficeRank = async() => {
      try {
        const res = await updateBoxofficeDB()
        console.log(res.data);
      } catch (error) {
        console.log("박스오피스 업데이트 로드 실패 : " , error);
      }
    }
    getUpdateBoxofficeRank() 
  },[])


  return (
    <>
    <HeaderBar/>

{/* TOP 카루셀 */}
<div style={{marginTop:'100px'}}>
<MainTopSection/>
</div>

{/* MID 카루셀 */}
<div style={{marginTop:'100px'}}>
  <MainMidSection/>
</div>

{/* BTM 카루셀 */}
<div style={{marginTop:'100px'}}>
  <MainBtmSection/>
</div>


<div style={{marginTop:'100px'}}>
  <Footer/> 
</div>
    </>
  )
}

export default MainPage
